import React from 'react'
import ReactDOM from 'react-dom'

const Hello = (props) => (
  <div>
    <p>Hello {props.name}, Age : {props.age}</p>
  </div>
)
const App = () => {
  const name = "Peter"
  const age = 10
  return (
    <div>
      <p>Greetings</p>
      <Hello name = {name} age = {age}/>
      <Hello name = "Bailey" age = {10 + 20}/>
    </div>
  )
}

